import React, { useState } from "react"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faDownload, faEdit, faTrash } from '@fortawesome/free-solid-svg-icons';
import UUID from "uuidjs"
import "./icon-bar.scss"

const IconBar = ({items, className}) =>{
    const [icons, _ ] = useState({
        download : faDownload,
        edit : faEdit,
        delete : faTrash,
    }) 

    return (
        <div className={"icon-bar " + className}>
            <ul className="icon-list">
                {items && items.Object.entries().map(([key, value]) => {
                    <li key={UUID.genV1()}>
                        <FontAwesomeIcon className={'icon ' + 'icon-'+key} icon={icons[key]} onClick={value.bind(null)}/>
                    </li>
                })}
            </ul>
        </div>
    )
}

export default IconBar;
